script: |
  super -f text -I q6801.spq | sort > q6801.out

inputs:
  - name: q6801.spq
    data: |
      SELECT DISTINCT col0 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT ( - ( + col1 ) * - col0 ) BETWEEN NULL AND 65;
  - name: tab2

outputs:
  - name: q6801.out
    data: |
      46
      64
      75
